import React, { Component } from 'react';
import '../App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHome, faMailBulk, faPhone } from '@fortawesome/free-solid-svg-icons';

export default class ContactBody extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="ContactBody">
                <div className="contact-info">
                    <div className="contact-info-title">
                        Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.
                    </div>
                    <div className="contact-info-detail">
                        <div className="contact-info-item flex">
                            <FontAwesomeIcon icon={faHome}/>
                            <p>ADDRESS</p>
                            <p>9606 North MoPac Expressway Suite 700 Austin, TX 78759</p>
                        </div>
                        <div className="contact-info-item flex">
                            <FontAwesomeIcon icon={faPhone}/>
                            <p>ADDRESS</p>
                            <p>9606 North MoPac Expressway Suite 700 Austin, TX 78759</p>
                        </div>
                        <div className="contact-info-item flex">
                            <FontAwesomeIcon icon={faMailBulk}/>
                            <p>ADDRESS</p>
                            <p>9606 North MoPac Expressway Suite 700 Austin, TX 78759</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
